        <button 
          className="dashboard-button" 
          onClick={()=>{
            navigate('/view-report');

          }}
        >
          View Reports
        </button>
        <button 
          className="dashboard-button" 
          onClick={() => navigate('/schedule-appointment')} // URL for Request Appointment section
        >
          Request Appointment
